import React from 'react';
import { DndProvider } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { useSearchParams, useNavigate } from 'react-router-dom';
import Toolbar from './create-page/Toolbar';
import ComponentLibrary from './create-page/ComponentLibrary';
import Canvas from './create-page/Canvas';
import PropertiesPanel from './create-page/PropertiesPanel';
import '../styles/CreateLanding.css';
import useLandingPage from '../hooks/useLandingPage';

const CreateLandingPage = () => {
    const [searchParams] = useSearchParams();
    const navigate = useNavigate();
    const pageId = searchParams.get('id');

    const {
        pageData,
        selectedIds,
        historyIndex,
        history,
        viewMode,
        zoomLevel,
        gridSize,
        showGrid,
        leftSidebarCollapsed,
        rightSidebarCollapsed,
        addElement,
        updatePosition,
        updateSize,
        deleteElement,
        selectElement,
        groupElements,
        undo,
        redo,
        handleZoom,
        handleSave,
        setViewMode,
        toggleGrid,
        setGridSize,
        toggleSidebar,
    } = useLandingPage(pageId, navigate);

    const handlePreview = () => {
        const htmlContent = renderStaticHTML(pageData);
        const newWindow = window.open('', '_blank');
        newWindow.document.write(htmlContent);
        newWindow.document.close();
    };

    const handlePublish = async () => {
        if (!pageId) {
            toast.error('Không tìm thấy ID trang để triển khai.');
            return;
        }

        try {
            await handleSave(); // Lưu trước khi publish
            const response = await api.post(`/api/pages/${pageId}/publish`);
            if (response.data.success && response.data.page?.url) {
                toast.success(`Triển khai thành công! Truy cập tại: ${response.data.page.url}`);
            } else {
                toast.error('Triển khai thất bại: ' + (response.data.error || 'Lỗi không xác định'));
            }
        } catch (error) {
            console.error('Lỗi khi triển khai:', error);
            toast.error('Lỗi khi triển khai trang: ' + (error.response?.data?.error || error.message));
        }
    };

    return (
        <DndProvider backend={HTML5Backend}>
            <div className="lpb-container">
                <link
                    rel="stylesheet"
                    href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.5.1/css/all.min.css"
                    crossOrigin="anonymous"
                    referrerPolicy="no-referrer"
                />
                <ToastContainer position="top-right" autoClose={3000} hideProgressBar />
                <Toolbar
                    onSave={handleSave}
                    onUndo={undo}
                    onRedo={redo}
                    canUndo={historyIndex > 0}
                    canRedo={historyIndex < history.length - 1}
                    viewMode={viewMode}
                    onViewModeChange={setViewMode}
                    onZoom={handleZoom}
                    onToggleGrid={toggleGrid}
                    showGrid={showGrid}
                    gridSize={gridSize}
                    onSetGridSize={setGridSize}
                    onPreview={handlePreview}
                    onPublish={handlePublish}
                />
                <div className="lpb-main-content">
                    <div className={`lpb-sidebar-left ${leftSidebarCollapsed ? 'lpb-sidebar-collapsed' : ''}`}>
                        <ComponentLibrary
                            isCollapsed={leftSidebarCollapsed}
                            onToggle={() => toggleSidebar('left')}
                            onAddElement={addElement}
                        />
                    </div>
                    <div className="lpb-canvas-container">
                        <Canvas
                            pageData={pageData}
                            selectedIds={selectedIds}
                            onSelectElement={selectElement}
                            onUpdatePosition={updatePosition}
                            onUpdateSize={updateSize}
                            onDeleteElement={deleteElement}
                            onAddElement={addElement}
                            onGroupElements={groupElements}
                            viewMode={viewMode}
                            zoomLevel={zoomLevel}
                            gridSize={gridSize}
                            showGrid={showGrid}
                        />
                    </div>
                    <div className={`lpb-sidebar-right ${rightSidebarCollapsed ? 'lpb-sidebar-collapsed' : ''}`}>
                        <PropertiesPanel
                            selectedElements={pageData.elements.filter((el) => selectedIds.includes(el.id))}
                            onUpdateElement={(id, updates) => updateSize(id, updates.size)}
                            isCollapsed={rightSidebarCollapsed}
                            onToggle={() => toggleSidebar('right')}
                        />
                    </div>
                </div>
            </div>
        </DndProvider>
    );
};

export default CreateLandingPage;
